    "1981 beached animal and plastic litter surveys report",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:03:08.085756",nt"name": "1981-beached-animal-and-plastic-litter-surveys-report",nt"isopen":
    false,nt"url": null,nt"notes": "A total of 119.63 km of beach were walked
    in 41 surveys (Appendix 1.). Birds and mammals were found on 16 of these surveys.
    There were 0.03 birds/km beach walked, and 0.14 mammals/km beach walked (Table 1).
    The cause of death was not determined for any of the beached animals. There were
    no observations of oil or any other unusual water conditions. Three goose-beaked
    whales (Ziphuis cavirostris) and one Stejaeger's beaked whale (Mesoplodon stejnegeri)
    were discovered in late July and early August. Two other whales beached at this
    time, one of which was returned to the ocean. The cause of beaching was not determined.
    Data and samples collected from these whales were sent to the Smithsonian Institute
    in Washington D.C. for analysis.",nt"license_title": "License Not Specified",nt"extras":
